import React from 'react';
import { Paper, Button } from '@material-ui/core';

export default class Policy extends React.Component {

  render() {
    return (
        <Paper>
          <Button>
          Your privacy is important to us.

          It is Coderals' policy to respect your privacy regarding any information we may collect from you through our apps.
          We only ask for personal information when we truly need it to provide a service to you, but you are always free to refuse our request for your personal information. We collect it by fair and lawful means, with your knowledge and consent. We also let you know why we’re collecting it and how it will be used.
          We only retain collected information for as long as necessary to provide you with your requested service. What data we store, we’ll protect within commercially acceptable means to prevent loss and theft, as well as unauthorized access, disclosure, copying, use or modification.
          We don’t share any personally identifying information publicly or with third-parties, except when required to by law.
          Your continued use of our apps and website will be regarded as acceptance of our practices around privacy and personal information. If you have any questions about how we handle user data and personal information, feel free to contact us.
          This policy is effective as of 31 December 2020.
          </Button>
        </Paper>
    );
  }
}
